import React from 'react'

class Multiplechkbox extends React.Component{
    render(){
        return(
        
        <div  style={{
            display: 'flex',  justifyContent:'center', alignItems:'center', height: '100vh'
          }}> 
            
               
                <input type="checkbox" name="Propaganda 1"/>Propaganda 1&nbsp;&nbsp;
                <input type="checkbox" name="Propaganda 2"/>Propaganda 2&nbsp;&nbsp;
                <input type="checkbox" name="Cricket"/>Propaganda 3&nbsp;&nbsp;
               
           

           

        </div>);
    }


}
export default Multiplechkbox;
